import React, { useState } from "react";
import TimeRange from "react-time-range";
import "./styles.css";

function TimePick(props) {
  const now = new Date();
  const [selectedTime, setSelectedTime] = useState(now);
  return (
    <TimeRange
      className="time-input"
      minuteIncrement={15}
      use24Hours={true}
      startLabel={null}
      endLabel={null}
      endMoment={null}
    />
  );
}

export default TimePick;
